remarks.code:
// Enable Trace feature:
DDTrace.Enable(DDTraceConfiguration);

// Use Tracer:
DDTracer.Shared.StartSpan(...);

var request = new HttpRequestMessage(...);

var writer = new DDW3CHTTPHeadersWriter();
var span = DDTracer.Shared.StartSpan("network request");
DDTracer.Shared.Inject(span.Context, OT.FormatTextMap, writer);

foreach (var (field, value) in writer.TraceHeaderFields)
{
    request.Headers.Add(field, value);
}

// call span.Finish() when the request completes

foreach (var (field, value) in writer.TraceHeaderFields)
{
    request.Headers.Add(field, value);
}

remarks.example:
Example:

    // span1 becomes active in this thread:
    var span1 = DDTracer.StartSpan(operationName: "root").SetActive();

    // As span2 has no explicit parent, it becomes the child of the active span1:
    var span2 = DDTracer.StartSpan(operationName: "child of span1");

    // As span3 has the explicit parent (null) it won't become the child of the active span:
    let span3 = tracer.startSpan(operationName: "another root", parent: null);
